A callback function called if the loading-process has been finish. It
has the following signature:
<pre><code>
// dataObject - A JavaScript Object which is the parsed JSON from the Data file or <b>null</b> if an error occurred.
// error - The error object or <b>null</b> if no error occurred.
function(dataObject, error) {}
</code></pre>

